					// 状态将自动序列化为 `window.__INITIAL_STATE__`，并注入 HTML。

					// context.state = store.state

					resolve(app)
				})
				.catch(reject)
		}, reject)
	})
}

import Vue from 'vue'
import Router from 'vue-router'
import App from 'E:/gls/vue-template/huae/src/App.vue'

